import React from "react";
import './Post.css'

function Post() {
    return(
        <div className="post">
            <img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fauthor.today%2Fpost%2F73018&psig=AOvVaw0pOAqimBzqdQgUnedxuR6T&ust=1649972775187000&source=images&cd=vfe&ved=0CAwQjRxqFwoTCKCPl92BkvcCFQAAAAAdAAAAABAH" alt="s"/>
            <div>Post1</div>
            <p>Like</p>
         </div>
    )
}
export default Post;
